import { View, Text, Image, StyleSheet } from 'react-native';

export default function Welcome() {
    return (
        <View style={sheet.container}>
            <Image source={require("../assets/images/logo.png")} style={{ height: "200px", width: "200px" }} />
            <Text style={sheet.text}>Paservi</Text>
        </View>
    );
}

const sheet = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: "#1C39CE",
        justifyContent: "center",
        alignItems: "center"
    },
    text:{
        fontSize:30,
        color:"#fff",
        fontWeight:"bold"
    }
})
